        <li class="span3">
      <div class="thumbnail">
        <img src="../modules/traffic/thumbnail.png" alt="">
        <div class="caption">
          <h3>Live traffic</h3>
          <p>This module shows the live traffic with a bandwidth chart and text. There is also informations about the current use of each ethernet protocol and IPV4 protocol.</p>
          
        </div>
      </div>
    </li>
        <li class="span3">
      <div class="thumbnail">
        <img src="../modules/monthlyTraffic/thumbnail.png" alt="">
        <div class="caption">
          <h3>Monthly traffic</h3>
          <p>This module shows the bandwith use for the last 30 days. You can see the local, up and down flow. The protocol use is also displayed.</p>
          
        </div>
      </div>
    </li>
        <li class="span3">
      <div class="thumbnail">
        <img src="../modules/network3D/thumbnail.png" alt="">
        <div class="caption">
          <h3>Network in 3D</h3>
          <p>This module represent each ip address on the network by a 3D form graviting around a SUN. Each communication is represented by a ray from the source to the recipient. If one of the ip address is outside the local network, the externam address is represented by the SUN. A table show the number of ip from every network.</p>
          
        </div>
      </div>
    </li>
        <li class="span3">
      <div class="thumbnail">
        <img src="../modules/serverStat/thumbnail.png" alt="">
        <div class="caption">
          <h3>Server statistics</h3>
          <p>Display several informations about the state of the data server. Processor load, memory load, swap load and packet loss.</p>
          
        </div>
      </div>
    </li>
        <li class="span3">
      <div class="thumbnail">
        <img src="../modules/stressServer/thumbnail.png" alt="">
        <div class="caption">
          <h3>Server stress</h3>
          <p>Show the live rate of packet loss with the number of packet received. A second chart show the same informatoins on a longer time.</p>
          
        </div>
      </div>
    </li>
        <li class="span3">
      <div class="thumbnail">
        <img src="../modules/summary/thumbnail.png" alt="">
        <div class="caption">
          <h3>Summary bandwidth</h3>
          <p>Display a simple chart with the total bandwidth use from the beginning of the record.</p>
          
        </div>
      </div>
    </li>
        <li class="span3">
      <div class="thumbnail">
        <img src="../modules/weeklyTraffic/thumbnail.png" alt="">
        <div class="caption">
          <h3>Weekly traffic</h3>
          <p>This module shows the bandwith use for the last 7 days. You can see the local, up and down flow. The protocol use is also displayed.</p>
          
        </div>
      </div>
    </li>
